// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import './style.css';
import data from './TemplateData.json';
import Home from './Home'; // Assuming you've created a Home.js file for the Home component
import Details from './Details'; // Assuming you've created a Details.js file for the Details component;

function App() {
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedYear, setSelectedYear] = useState("");

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/details">Details</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/details">
            <Details />
          </Route>
          <Route path="/">
            <Home
              data={data}
              searchTerm={searchTerm}
              selectedYear={selectedYear}
              setSearchTerm={setSearchTerm}
              setSelectedYear={setSelectedYear}
            />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
